//        final int h = Noise.IntPointHash.hashAll(x >>> 6, y >>> 6, seed);
        //ALT_NOISE[s][(y + Integer.bitCount(h) - 4 << 6 & 0xFC0) | (x + Integer.bitCount((h ^ 0xD1B54A35) * 0x125493) - 4 & 0x3F)];
//                (byte) (ALT_NOISE[s][(y << 6 & 0xFC0) | (x & 0x3F)] ^
